this.options.templateParameters = this.options.templateParameters.filter(
  item => item.Ce_item_block === this.parameters.block)

// Shuffle the elements in each block 
const group = this.options.templateParameters; 
const shuffled_group = this.random.shuffleTable(group); 

// Look for any possible consequent repetition 
for (let i = 0; i < 24; i++) {
  var temp = shuffled_group[i].Cb_id; 
  if (i == 0) {
    var before = "null"; 
  }
  else{
      var before = shuffled_group[i-1].Cb_id; 
  }
  if (temp == before){
    console.log("repeated element!!! ")
    console.log(shuffled_group[i])
    // Send element to the end of the list if repeated
    // But if it's the last element, then send it to the first 
    let element = shuffled_group[i]; 
    if (i == 24){
      shuffled_group.unshift(element); 
    }
    else{
      shuffled_group.push(element); 
    }
    shuffled_group.splice(i, 1); // Delete the element once moved
  }
  temp = before;
}

// Update templateParameters with the new shuffled array 
this.options.templateParameters = shuffled_group; 
